INSERT INTO `informe_tecnico` (`id`, `local`, `sector`, `equipo_asistido`, `orden_trabajo`, `patrimonio`, `jefe_turno`, `observaciones`, `firma_digital`, `fecha_creacion`, `tecnico_id`, `foto_trabajo`) VALUES
(47, 'S6 hiper ', 'Recepción bascula', 'Báscula balanza verdulería ', '1', '46121', 'Josue', 'Se verifica la báscula con problema de cableado, se corta y conecta el cable se calibra la báscula se deja funcionando.\r\nSe verifica la balanza de verdulería se cambia el calble de red se deja en linea ,se prueba todo el funcionamiento.', 'data:image/png;base64,', '2025-05-03 18:14:31', 19, NULL),
(48, 'S6 mundimark', 'Carniceria', 'Balanza', '10579904', '1', 'Aldo solis', 'Se realizo la limpieza y calibración del sensor de etiqueta ', 'data:image/png;base64,', '2025-05-03 18:26:23', 22, NULL),
(49, 'S6 españa', 'RM', 'Bascula ', '10580088', '0', 'Jose villalba ', 'Se realizo el cambio de cable y calibración de bascula', 'data:image/png;base64,', '2025-05-05 18:17:59', 22, NULL),
(50, 'S6 madero', 'Carniceria', 'Báscula balanza carniceria', '1', '40227', 'Ismael fernandez', 'Se procede a verificar la balanzA de carnicería con problema de teclado se prueba y deja funcionando.\r\nSe verifica el monitor tv de tauser se configura la entrada de video dejando funcionando.\r\nQueda pendiente el retiro de una balanza para su reparación en el taller de tic por problemas varios.', 'data:image/png;base64,', '2025-05-05 18:32:40', 19, NULL),
(51, 'S6 mundimark ', 'Carnicería ', 'Balanza con problema de teclado ', '10580163', '36075', 'Aldo Solis', 'Se realizó la verificación correspondientes de la balanza,la misma se encontraba mojada, procedimos a cambiar teclado y placa de teclado pero sigue sin funcionar ', 'data:image/png;base64,', '2025-05-05 19:51:26', 33, NULL),
(52, 'Stock Callei', 'RM/ Básculas, CCTV/ Audio', 'Bascula de 1000 kg', '40000284593', 'N/A', 'Liz Lopez', 'Se realizó la verificación de la báscula de rm se procedió al cambio de cable, cambio de la celda inferior derecha y la calibración del mismo. Queda funcionando correctamente. También se realizó el cambio del equipo de audio/ amplificador. Queda funcionando correctamente.', 'data:image/png;base64,', '2025-05-05 20:11:53', 25, NULL),
(53, 'S6 denis roa', 'Panaderia', 'No imprime', '1', '1', 'Paola ferreira', 'Se procede a configurar los sensores de la hoja se ajusta el tamaño del papel se prueba y deja funcionando.\r\nSe repara el cable de red \r\nSe verifican las balanzas de carnicería, panadería, fiambrería ', 'data:image/png;base64,', '2025-05-05 21:09:26', 19, NULL),
(54, 'Stock Capiata R1', 'Carniceria - pollería - fiambrería ', 'Conexión para balanza de los sectores ', '40000283134', 'N/A', 'Lourdes Colman', 'Se realizó la verificación y el relevamiento para conexión de balanza de los sectores carniceria - pollería - fiambrería. Se procedió a la conexión provisoria para la balanza de carnicería \r\nObs: queda pendiente traer materiales para poder realizar todas la conexiones de datos y alimentación.', 'data:image/png;base64,', '2025-05-05 21:48:21', 25, NULL);
