(66, 'S6 Negrita ', 'Cámara de salon', 'Cámara sin imagen', '10580689', 'S/P', 'Robert Coronel ', 'Se realizó la verificación correspondientes de cámara del salón\r\nSe cambió la fuente y video valun ahora queda en operativo la cámara de salon y cctv', 'data:image/png;base64,', '2025-05-07 18:51:42', 28, NULL),
