(68, 'S6 Encar 1', 'linea de cajas', 'teclado de caja 9', '40000285181', '136274', 'Juan Enciso', 'desmontaje de teclado y secado ya que el equipo se encontraba con liquido en su interior. una vez secado se procedió al montaje y prueba de su funcionamiento.', 'data:image/png;base64,', '2025-05-07 23:08:50', 35, NULL),
(69, 'S6 mburucuya', 'Tauser', 'Alarma', '1', '1', 'Yesica dorigoni', 'Se verifica el sensor de la alarma de la puerta del tauser se prueba la puerta externa e interna se encuentra funcionando los sensores de movimiento y puertas\r\nSe prueban los pulsadores de pánico cambiando pila al de linea de cajas.\r\nSe verifican las balanzas de verdulería carnicería panadería se encuentran funcionando.', 'data:image/png;base64,', '2025-05-07 23:17:28', 19, NULL),
(70, 'Stk Don Bosco ', 'CCTV ', 'Camara CCTV ', '10578172', 'No tiene activó ', 'Mirella Rivas ', 'Se realizó la reubicación de la camara CCTV que enfoca hacía el estacionamiento ', 'data:image/png;base64,', '2025-05-07 23:31:26', 23, NULL);
